const data = [
"https://www.chimerarevo.com/wp-content/uploads/2020/04/immagini-gratis.jpg",
"https://i1.wp.com/www.giacomocusano.com/wp-content/uploads/2016/07/coastal-wash-web.jpg?fit=1024%2C682&ssl=1",
"https://www.artemedialab.it/wp-content/uploads/2019/04/immagini-sfondo-1-700x400.jpg",
"https://www.radiomontecarlo.net/resizer/1200/720/true/cosmo-1592899369678.jpg--una_meravigliosa_farfalla_cosmica_si_aggira_nello_spazio__le_immagini_sono_mozzafiato.jpg?1592899369000"]

const Sliderone = () => {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };

        return (
          <Slider {...settings}>
            <div>
              <img src={data[0]} alt="ide" />
            </div>
            <div>
            <img src={data[1]} alt="ide" />
            </div>
            <div>
            <img src={data[2]} alt="ide" />
            </div>
            <div>
            <img src={data[3]} alt="ide" />
            </div>
            <div>
            <img src={data[4]} alt="ide" />
            </div>
            <div>
            <img src={data[5]} alt="ide" />
            </div>
          </Slider>
        );
      }


export default Sliderone;
